import React from 'react';
import {ProfileContainer, UserContainer, UserAvatar, UserName, UserTag, UserLocation, UserStats, UserStatsLi } from './Profile.styled';

export const Profile = props => {
  const { username, tag, location, avatar, stats } = props;
  return (
    <ProfileContainer class="profile">
      <UserContainer className="description">
        <UserAvatar src={avatar} alt="User avatar" className="avatar" />
        <UserName className="name">{username}</UserName>
        <UserTag className="tag">{tag}</UserTag>
        <UserLocation className="location">{location}</UserLocation>
      </UserContainer>
      <UserStats className="stats">
        <UserStatsLi>
          <span className="label">Followers</span>
          <span className="quantity">{stats.followers}</span>
        </UserStatsLi>
        <UserStatsLi>
          <span className="label">Views</span>
          <span className="quantity">{stats.views}</span>
        </UserStatsLi>
        <UserStatsLi>
          <span className="label">Likes</span>
          <span className="quantity">{stats.likes}</span>
        </UserStatsLi>
      </UserStats>
    </ProfileContainer>
  );
};
